  const Header = (props) => {
    return(
      <h1>{props.course}</h1>
    )
  }
  const Content = (props) => {
    return (
      <p>
        {props.part} {props.exercise}
      </p>
    )
  }
  const Total = (props) => {
    return (
      <p>Number of exercises {props.total_score}</p>
    )
  }
  return (
    <div>
      <h1>{course}</h1>
